import React, { FC, memo } from 'react';
import Section from '../Section/Section';
import './Education.scss';

const Education: FC = () => {
  return (
    <Section>
      <div id='education' className='education'>
        <h2>Education</h2>
        <article>
          <h3>SoftUni</h3>
          <p className='education--bold'>Software Engineer</p>
          <p>Jun 2016 - Dec 2017</p>
          <p>
            Activities and societies: Programming Fundamentals, JavaScript
            Advanced, HTML & CSS / SASS React JS - Framework
          </p>
        </article>
      </div>
    </Section>
  );
};

export default memo(Education);
